import React, { useRef, useState } from 'react';
import html2canvas from 'html2canvas';
import { write } from 'clipboard-polyfill';
import { ToastContainer, toast } from 'react-toastify';

const FifthPage = () => {
    const screenshotRef = useRef(null);

    const [data, setData] = useState({
        time: "6:31",
        message1: "You paid 100 CAD to CESAR VERDECIA SUAREZ",
        message2: "LLC",
    });

    const [imageDimension, setImageDimension] = useState("167");


    const onChangeHandler = (e) => {
        setData({ ...data, [e.target.name]: e.target.value });
    }

    const notify = (message) => toast.success(message, {
        containerId: 'success-toast',
        style: {
            background: 'black',
            color: 'white',
        },
    });

    const takeScreenshot = async () => {
        try {
            const canvas = await html2canvas(screenshotRef.current);
            const dataURL = canvas.toDataURL('image/png');

            const img = new Image();
            img.src = dataURL;

            img.onload = () => {
                const canvas = document.createElement("canvas");
                canvas.width = img.width;
                canvas.height = img.height;

                const context = canvas.getContext("2d");
                context.drawImage(img, 0, 0);

                // Convert canvas to blob
                canvas.toBlob((blob) => {
                    const clipboardItem = new ClipboardItem({ [blob.type]: blob });

                    // Use the clipboard-polyfill to copy the item
                    write([clipboardItem]).then(() => {
                        notify("Copied to clipboard");
                    }).catch((error) => {
                        console.error("Error copying image:", error);
                    });
                }, img.type);
            };
        } catch (error) {
            console.error('Error taking screenshot:', error);
        }
    };

    return (
        <>
            <div className="billing_childs">
                <ToastContainer autoClose={1000} />
                <div className="app-heading">
                    <h3>PREVIEW - <span>Mobile 5</span></h3>
                    <div class="slidecontainer">
                        <button onClick={() => takeScreenshot()}>Screenshot <i className="fa fa-copy"></i></button>
                        <span>{imageDimension + "%"}</span>
                        <input
                            type="range"
                            min="1"
                            max="500"
                            className="slider"
                            name="imageDimension"
                            value={imageDimension}
                            onChange={(e) => setImageDimension(e.target.value)}
                        />
                    </div>
                </div>
                <div className="mobile-view-wrapper">
                    <div className="artboard">
                        <foreignObject ref={screenshotRef}>
                            <svg
                                xmlns="http://www.w3.org/2000/svg"
                                xmlnsXlink="http://www.w3.org/1999/xlink"
                                width={imageDimension + "%"}
                                viewBox="0 0 1664 3605"
                            >
                                <defs>
                                    <pattern
                                        id="pattern"
                                        width="100%"
                                        height="100%"
                                        preserveAspectRatio="none"
                                        viewBox="0 0 91 21"
                                    >
                                        <image
                                            width="91"
                                            height="21"
                                            xlinkHref="data:image/png;base64,"
                                        ></image>
                                    </pattern>
                                    <pattern
                                        id="pattern-2"
                                        width="100%"
                                        height="100%"
                                        preserveAspectRatio="none"
                                        viewBox="0 0 331 104"
                                    >
                                        <image
                                            width="331"
                                            height="104"
                                            xlinkHref="data:image/png;base64,"
                                        ></image>
                                    </pattern>
                                </defs>
                                <g data-name="Group 3" transform="translate(-1050 -148)">
                                    <g
                                        fill="#173300"
                                        stroke="#707070"
                                        strokeWidth="1"
                                        data-name="Rectangle 28"
                                        transform="translate(1050 148)"
                                    >
                                        <path stroke="none" d="M0 0H1664V3605H0z"></path>
                                        <path fill="none" d="M0.5 0.5H1663.5V3604.5H0.5z"></path>
                                    </g>
                                    <text
                                        fill="#cfcfd1"
                                        data-name="6:31"
                                        fontFamily="Roboto-Bold, Roboto"
                                        fontSize="64"
                                        fontWeight="700"
                                        transform="translate(1214 267)"
                                    >
                                        <tspan x="0" y="0">
                                            {data.time}
                                        </tspan>
                                    </text>
                                    <image
                                        width="900"
                                        height="960"
                                        data-name="Screenshot 2023-08-05 231238"
                                        transform="translate(1432 719)"
                                        xlinkHref="data:image/png;base64,"
                                    ></image>
                                    <text
                                        fill="#cfcfd1"
                                        data-name="You paid 100 CAD to CESAR VERDECIA SUAREZ LLC."
                                        fontFamily="Roboto-Regular, Roboto"
                                        fontSize="67"
                                        transform="translate(1883 2050)"
                                    >
                                        <tspan x="0" y="0" textAnchor="middle">
                                            {data.message1}{" "}
                                        </tspan>
                                        <tspan x="0" y="108" textAnchor="middle">
                                            {data.message2}
                                        </tspan>
                                    </text>
                                    <g
                                        fill="#9ee771"
                                        stroke="#707070"
                                        strokeWidth="1"
                                        data-name="Rectangle 29"
                                        transform="translate(1113 3395)"
                                    >
                                        <rect width="1539" height="208" stroke="none" rx="100"></rect>
                                        <rect
                                            width="1538"
                                            height="207"
                                            x="0.5"
                                            y="0.5"
                                            fill="none"
                                            rx="99.5"
                                        ></rect>
                                    </g>
                                    <text
                                        fill="#1d4e0a"
                                        fontFamily="Arial-BoldMT, Arial"
                                        fontSize="65"
                                        fontWeight="700"
                                        transform="translate(1801 3522)"
                                    >
                                        <tspan x="0" y="0">
                                            Done
                                        </tspan>
                                    </text>
                                    <image
                                        width="380"
                                        height="177"
                                        data-name="Image 5"
                                        transform="translate(2300 156)"
                                        xlinkHref="data:image/png;base64,"
                                    ></image>
                                    <path
                                        fill="url(#pattern-2)"
                                        d="M0 0H999V314H0z"
                                        data-name="Image 6"
                                        transform="translate(1383 1650)"
                                    ></path>
                                    <rect
                                        width="590"
                                        height="24"
                                        fill="#fff"
                                        data-name="Rectangle 33"
                                        rx="12"
                                        transform="translate(1587 3698)"
                                    ></rect>
                                </g>
                            </svg>
                        </foreignObject>
                    </div>
                </div>
            </div>
            <div className="billing_childs">
                <div className="app-heading">
                    <h3>CONTROLS</h3>
                </div>
                <div className="global_form_wrapper">
                    <div className="global_form_inner">
                        <label>Time</label>
                        <input
                            type="text"
                            value={data.time}
                            name="time"
                            onChange={(e) => onChangeHandler(e)}
                        />
                    </div>
                    <div className="global_form_inner">
                        <label>Message</label>
                        <input
                            type="text"
                            value={data.message1}
                            name="message1"
                            onChange={(e) => onChangeHandler(e)}
                        />
                        <input
                            type="text"
                            value={data.message2}
                            name="message2"
                            onChange={(e) => onChangeHandler(e)}
                        />
                    </div>
                </div>
            </div>
        </>
    )
}

export default FifthPage;